import React from 'react';
import Radium from 'radium';
//import styled from 'styled-components';
//import './App.css';
const Header=(props)=> {

const ShiromedaStyle={
     color:'red',
     fontSize:'xx-large'
}
const signupstype={
     marginLeft:"40em",
}
     return(
      <header>
        <ul className="nav">
          <li style={ShiromedaStyle}><a href="/">Shiro Meda</a></li>
          <li><a href='/'>Add</a></li>
          <li style={signupstype}><a href=''>signup</a></li>
          <li><a>SignIn</a></li>
        </ul>
      </header>
     )
}
export default Radium(Header);
